  \"2016-03-31T23:56:23.478611\",\n\t\"name\": \"enviroatlas-average-direct-normal-solar-resources-kwh-m2-day-by-12-digit-huc-for-the-contermin\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The annual average direct normal solar
  resources by 12-Digit Hydrologic Unit (HUC) was estimated from maps produced by
  the National Renewable Energy Laboratory for the U.S. Department of Energy (February
  2009). The original data was from 10km, satellite modeled dataset (SUNY/NREL, 2007)
  representing data from 1998-2005. The 10km data was converted to 30m grid cells,
  and then zonal statistics were estimated for a final value of average kWh/m2/day
  for each 12-digit HUC. For more information about the original dataset please refer
  to the National Renewable Energy Laboratory (NREL) website at www.nrel.gov/gis/data_solar.html.
  This dataset was produced by the US EPA to support research and online mapping activities
  related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the
  user to interact with a web-based, easy-to-use, mapping application to view and
  analyze multiple ecosystem services for the contiguous United States. The dataset
  is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
